sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new AmazonRDSUtils().trimStringInputs(inputs);
    var session = gs.getSession();
    session.putClientData('SN_AWS_RDS_REGION', inputs.region ||
    "us-east-1");
    session.putClientData('SN_AWS_RDS_FILTER', null);
    outputs.read_replica_identifier = inputs.read_replica_identifier;
    outputs.source_db_instance_identifier = inputs
        .source_db_instance_identifier;
    outputs.region = inputs.region;
})(inputs, outputs);

